import React from 'react';
import css from '../styles/fav.module.css'

const Fav = () => {
  return (
    <div className={css.container}>
      <div className={css.headerContainer}>
        <h1 className={css.header}>Favorites</h1>
      </div>
    </div>
  );
};

export default Fav;
